class Solution {
public:
    vector<int> findAnagrams(string s, string p) {
        int m = s.size();
        int n = p.size();
        if (m < n)
            return {};
        unordered_map<char, int> f, g;
        for (char &c:p)
            ++f[c];
        int cnt = 0;
        int i = 0;
        vector<int> res;
        for (int j = 0; j < m; ++j) {
            if (!f.count(s[j])) {
                i = j + 1;
                g.clear();
                cnt = 0;
                continue;
            }
            ++g[s[j]];
            if (g[s[j]] == f[s[j]])
                ++cnt;
            while (i <= j && g[s[j]] > f[s[j]]) {
                if (g[s[i]] == f[s[i]])
                    --cnt;
                --g[s[i]];
                ++i;
            }
            if (cnt == f.size()) {
                res.emplace_back(i);
            }
        }
        return res;
    }
};


int main(int argc, char* argv[]) {

    string s = "cbaebabacd";
    string p = "abc";

    Solution().findAnagrams(s,p);

    s="";
    p="";

    Solution().findAnagrams(s,p);

    return 0;
}

